
/*Table structure for table `tlistacol` */

DROP TABLE IF EXISTS `tlistacol`;

CREATE TABLE `tlistacol` (
  `IdColab` bigint(50) NOT NULL COMMENT 'Identificacion Colaborador',
  `NombCol` varchar(255) DEFAULT NULL COMMENT 'Nombre Colaborador',
  `CarCol` varchar(255) DEFAULT NULL COMMENT 'Cargo del colaborador',
  `FeInCol` varchar(30) DEFAULT NULL COMMENT 'fecha ingreso',
  `FeReCol` varchar(30) DEFAULT NULL COMMENT 'fecha retiro',
  `DepCol` varchar(255) DEFAULT NULL COMMENT 'Division a la que pertenece',
  `SubDivCol` varchar(255) DEFAULT NULL COMMENT 'Subdivision a la que pertenece',
  `JefeCol` varchar(255) DEFAULT NULL COMMENT 'Jefe del colaborador',
  PRIMARY KEY (`IdColab`)
) ENGINE=MyISAM DEFAULT CHARSET=latin1;

